    "ecology-of-wolverines-in-northwest-alaska-report-to-the-u-s-fish-and-wildlife-service",nt"isopen":
    false,nt"url": null,nt"notes": "In response to proposed oil and gas exploration
    and development activities in the National Petroleum Reserve- Alaska (NPR-A), a
    study of wolverine ecology was initiated in 1978 as part of a larger research program
    by the U.S. Fish and Wildlife Service on selected wildlife species in NPR-A. The
    purpose of this paper is to report on how the findings of this study relate: home
    range and movements and to compare these findings with those from other wolverine
    populations.",nt"license_title": "License Not Specified",nt"extras":
